import React from 'react';
import { View, TextInput, TouchableOpacity } from 'react-native-elements';

function PropertyRow({ property, styles }) {
  return (
    <View style={styles.addItemModal__block__row}>
      <TextInput
        placeholder="Property name"
        value={property.name}
        onChangeText={(text) => { property.value = text; }}
      />
      <TextInput
        placeholder="value"
        value={property.value}
        onChangeText={(text) => { property.value = text; }}
      />
      <TouchableOpacity>
        <Image source={garbageIcon} style={styles.garbageIcon} />
      </TouchableOpacity>
    </View>
  );
}

export default PropertyRow;
